from Codon_table import codon_table
from typing import List

rna_string = ''
rna = []
codons = []
print(len(rna_string))


def rna_codon_converter(string):
    rna = list(rna_string)
    for i in range(len(rna_string)):

        if i % 3 == 0:
            cd = ''.join(rna[i:i+3])
            codons.append(cd)
        else:
            pass
    return codons


print(len(codons))

mid = rna_codon_converter(rna_string)


def codon_prot_converter(x: List):
    prot_seq = []
    for i in x:
        prot = codon_table[i]
        prot_seq.append(prot)
    return ''.join(prot_seq)


protein_seq = codon_prot_converter(mid)
print(protein_seq)
